import React, { useEffect, useState } from "react";
import {
  adminListOfEmployees,
  adminDeleteEmployeeById,
} from "../services/EmployeeService";
import { useNavigate } from "react-router-dom";
import { FaArrowLeft, FaEdit, FaTrash } from "react-icons/fa";
import toast, { Toaster } from "react-hot-toast";
import { addAdminNotification } from "./adminNotifications";
import jsPDF from "jspdf";
import autoTable from "jspdf-autotable";

const AdminEmployees = () => {
  const navigate = useNavigate();

  const [employees, setEmployees] = useState([]);
  const [search, setSearch] = useState("");

  /* ================= LOAD EMPLOYEES ================= */
  const loadEmployees = async () => {
    try {
      const res = await adminListOfEmployees();
      setEmployees(res.data);
    } catch {
      toast.error("Failed to load employees");
    }
  };

  useEffect(() => {
    loadEmployees();
  }, []);

  /* ================= DELETE EMPLOYEE ================= */
  const handleDelete = async (emp) => {
    if (!window.confirm("Are you sure you want to delete this employee?"))
      return;

    try {
      await adminDeleteEmployeeById(emp.id);

      toast.success("Employee deleted successfully");

      addAdminNotification(
        `ðŸ—‘ï¸ Employee deleted | ID: ${emp.employeeId} Name: ${emp.firstName} ${emp.lastName}`
      );

      setEmployees((prev) => prev.filter((e) => e.id !== emp.id));
    } catch {
      toast.error("Failed to delete employee");
    }
  };

  /* ================= SEARCH ================= */
  const filtered = employees.filter((emp) =>
    `${emp.firstName} ${emp.lastName} ${emp.email} ${emp.employeeId}`
      .toLowerCase()
      .includes(search.toLowerCase())
  );

  /* ================= FORMAT DATE ================= */
  const formatDate = (value) => {
    if (!value) return "â€”";
    return new Date(value).toLocaleString("en-IN", {
      day: "2-digit",
      month: "short",
      year: "numeric",
      hour: "2-digit",
      minute: "2-digit",
    });
  };

  /* ================= WORKING HOURS ================= */
  const calculateWorkingHours = (punchIn, punchOut) => {
    if (!punchIn || !punchOut) return "â€”";
    const diff = new Date(punchOut) - new Date(punchIn);
    if (diff <= 0) return "â€”";
    const h = Math.floor(diff / 3600000);
    const m = Math.floor((diff % 3600000) / 60000);
    return `${h}h ${m}m`;
  };

  /* ================= EXPORT PDF ================= */
  const exportPDF = () => {
    const doc = new jsPDF("landscape");
    // ðŸ‘‡ REPLACE WITH YOUR LOGO BASE64
    const COMPANY_LOGO_BASE64 =
      "data:image/png;base64,";

    /* ================= LOGO ================= */
    doc.addImage(COMPANY_LOGO_BASE64, "PNG", 14, 6, 30, 18);

    /* ================= COMPANY DETAILS ================= */
    const companyName = "EMS Pvt. Ltd.";
    const companyTagline = "Employee Management System";

    doc.setFontSize(16);
    doc.setTextColor(40);
    doc.text(companyName, 50, 16);

    doc.setFontSize(10);
    doc.setTextColor(100);
    doc.text(companyTagline, 50, 22);

    /* ================= ADMIN DETAILS ================= */
    const adminName = localStorage.getItem("fullName") || "Admin User";
    const adminId = localStorage.getItem("adminId") || "ADM001";

    doc.setFontSize(10);
    doc.setTextColor(60);
    doc.text(`Generated By: ${adminName} (${adminId})`, 200, 16);
    doc.text(`Generated On: ${new Date().toLocaleString("en-IN")}`, 200, 22);

    /* ================= DIVIDER ================= */
    doc.setDrawColor(200);
    doc.line(14, 28, 283, 28);

    /* ================= REPORT TITLE ================= */
    doc.setFillColor(242, 195, 139);
    doc.roundedRect(14, 32, 269, 12, 3, 3, "F");

    doc.setFontSize(14);
    doc.setTextColor(0);
    doc.text("Employee Attendance Report", 18, 41);

    /* ================= TABLE ================= */
    autoTable(doc, {
      startY: 50,
      head: [
        [
          "#",
          "Employee ID",
          "Name",
          "Email",
          "Phone",
          "Punch In",
          "Punch Out",
          "Working Hours",
        ],
      ],
      body: filtered.map((emp, i) => [
        i + 1,
        emp.employeeId,
        `${emp.firstName} ${emp.lastName}`,
        emp.email,
        emp.phoneNumber,
        formatDate(emp.punchIn),
        formatDate(emp.punchOut),
        calculateWorkingHours(emp.punchIn, emp.punchOut),
      ]),
      styles: {
        fontSize: 9,
        cellPadding: 4,
      },
      headStyles: {
        fillColor: [106, 90, 249],
        textColor: 255,
        fontStyle: "bold",
      },
      alternateRowStyles: {
        fillColor: [245, 245, 245],
      },
      margin: { left: 14, right: 14 },
    });

    /* ================= SIGNED BY ADMIN (RIGHT BOTTOM) ================= */
    const pageHeight = doc.internal.pageSize.height;
    const rightX = 200; // right side position
    const bottomY = pageHeight - 45; // bottom margin

    doc.setFontSize(9);
    doc.setTextColor(80);
    doc.text("Authorized & Signed By:", rightX, bottomY);

    doc.setFontSize(10);
    doc.setTextColor(40);
    doc.text(adminName, rightX, bottomY + 7);

    doc.setFontSize(8);
    doc.setTextColor(120);
    doc.text(`Admin ID: ${adminId}`, rightX, bottomY + 13);
    doc.text("System Administrator", rightX, bottomY + 18);

    /* ===== SIGNATURE LINE ===== */
    doc.setDrawColor(120);
    doc.line(rightX, bottomY + 22, rightX + 60, bottomY + 22);

    doc.setFontSize(7);
    doc.setTextColor(150);
    doc.text("Digital Signature", rightX, bottomY + 27);

    /* ================= FOOTER ================= */
    const pageCount = doc.getNumberOfPages();
    for (let i = 1; i <= pageCount; i++) {
      doc.setPage(i);
      doc.setFontSize(9);
      doc.setTextColor(150);
      doc.text(
        `Â© ${new Date().getFullYear()} ${companyName} | Page ${i} of ${pageCount}`,
        14,
        205
      );
    }

    /* ================= SAVE ================= */
    addAdminNotification(`Employee PDF Exported`);
    doc.save("employee-attendance-report.pdf");
  };

  return (
    <>
      <Toaster position="top-right" />

      <div className="admin-page">
        <div className="admin-card">
          {/* HEADER */}
          <div className="header-row">
            <h2>Employee Attendance Overview</h2>

            <div className="header-actions">
              <button
                className="back-btn"
                onClick={() => navigate("/admin-dashboard")}>
                <FaArrowLeft /> Back
              </button>
              <button className="export-btn" onClick={exportPDF}>
                Export PDF
              </button>
            </div>
          </div>

          {/* SEARCH */}
          <input
            className="search-box"
            placeholder="Search by name, email, employee ID..."
            value={search}
            onChange={(e) => setSearch(e.target.value)}
          />

          {/* TABLE */}
          <table className="admin-table">
            <thead>
              <tr>
                <th>#</th>
                <th>Employee ID</th>
                <th>Name</th>
                <th>Email</th>
                <th>Phone</th>
                <th>Punch In</th>
                <th>Punch Out</th>
                <th>Working Hours</th>
                <th>Actions</th>
              </tr>
            </thead>

            <tbody>
              {filtered.length === 0 && (
                <tr>
                  <td colSpan="9" className="no-data">
                    No employees found
                  </td>
                </tr>
              )}

              {filtered.map((emp, index) => (
                <tr key={emp.id}>
                  <td>{index + 1}</td>
                  <td>
                    <span className="emp-badge">{emp.employeeId}</span>
                  </td>
                  <td>
                    {emp.firstName} {emp.lastName}
                  </td>
                  <td className="muted">{emp.email}</td>
                  <td>{emp.phoneNumber}</td>
                  <td className="success">{formatDate(emp.punchIn)}</td>
                  <td className="danger">{formatDate(emp.punchOut)}</td>
                  <td className="hours">
                    {calculateWorkingHours(emp.punchIn, emp.punchOut)}
                  </td>
                  <td className="actions">
                    <button
                      className="icon-btn edit"
                      onClick={() => navigate(`/edit-employee/${emp.id}`)}>
                      <FaEdit />
                    </button>
                    <button
                      className="icon-btn delete"
                      onClick={() => handleDelete(emp)}>
                      <FaTrash />
                    </button>
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>

        {/* ================= CSS ================= */}
        <style>{`
          .admin-page {
            min-height: 100vh;
            background: #f6e0c2;
            padding: 40px;
            display: flex;
            justify-content: center;
          }

          .admin-card {
            width: 100%;
            max-width: 1200px;
            background: #0f0f0f;
            color: #fff;
            padding: 35px;
            border-radius: 22px;
            box-shadow: 0 30px 60px rgba(0,0,0,0.4);
          }

          .header-row {
            display: flex;
            justify-content: space-between;
            align-items: center;
            margin-bottom: 25px;
          }

          .header-row h2 {
            color: #f2c38b;
          }

          .header-actions {
            display: flex;
            gap: 12px;
          }

          .back-btn, .export-btn {
            border-radius: 20px;
            padding: 8px 16px;
            font-weight: 600;
            cursor: pointer;
          }

          .back-btn {
            background: transparent;
            border: 1px solid #f2c38b;
            color: #f2c38b;
          }

          .export-btn {
            background: #f2c38b;
            border: none;
            color: #000;
          }

          .search-box {
            width: 100%;
            padding: 12px;
            border-radius: 30px;
            border: 1px solid #333;
            background: #1f1f1f;
            color: #fff;
            margin-bottom: 25px;
          }

          .admin-table {
            width: 100%;
            border-collapse: collapse;
          }

          .admin-table thead {
            background: linear-gradient(90deg,#6a5af9,#c048ff);
          }

          .admin-table th, .admin-table td {
            padding: 12px;
            border-bottom: 1px solid #222;
            text-align: left;
          }

          .emp-badge {
            background: #1f1f1f;
            color: #f2c38b;
            padding: 4px 12px;
            border-radius: 999px;
            font-size: 0.8rem;
            font-weight: 700;
          }

          .muted { color: #bbb; }
          .success { color: #4ade80; }
          .danger { color: #f87171; }
          .hours { color: #60a5fa; font-weight: 700; }

          .actions {
            display: flex;
            gap: 10px;
          }

          .icon-btn {
            background: #1f1f1f;
            border: 1px solid #333;
            color: #fff;
            padding: 8px;
            border-radius: 10px;
            cursor: pointer;
          }

          .icon-btn.edit:hover { background: #2563eb; }
          .icon-btn.delete:hover { background: #dc2626; }

          .no-data {
            text-align: center;
            padding: 20px;
            color: #bbb;
          }
        `}</style>
      </div>
    </>
  );
};

export default AdminEmployees;
